function App() {
  return (
    <div>
      <h1 className="">"Pray, dost thou know the weather foretold?<br /> 'Tis a tempest brewing, or so I've been told.<br /> But whether the skies be clear or not,<br /> 'Tis certain we shall weather the lot!"</h1>
    </div>
  );
}

export default App;
